 () => {
  const router = useRouter();
  const meQuery = queries.useGetMeWithContext();

  return (
    <Div className="flex flex-1 flex-col mx-10">
      <P className="text-4xl">Login</P>
      <FunctionForm
        hideResult
        tsFunction={Index}
        withApiResult={(
          result: RealApiReturnType<"loginWithPasswordWithContext">
        ) => {
          if (result.isSuccessful && result.result?.isSuccessful) {
            router.push("/");
          }
          meQuery.refetch();
          successToast(
            result.result?.message || result.message || "No message"
          );
        }}
      />
      <ALink href="/signup">Or click here to sign up</ALink>
    </Div>
  );
}
